--
-- Name: authenticate(character varying, character varying); Type: FUNCTION; Schema: public; Owner: doadmin
--

CREATE FUNCTION public.authenticate(username character varying, password character varying) RETURNS users.jwt
    LANGUAGE plpgsql STRICT SECURITY DEFINER
    AS $$
DECLARE
    un ALIAS FOR username;
    pw ALIAS FOR password;
    authenticatee users.users%ROWTYPE;
BEGIN
    SELECT * FROM users.users
    INTO authenticatee
    WHERE users.users.username = un;

    IF authenticatee.password_hash = CRYPT(pw, authenticatee.password_hash) THEN
        UPDATE users.users
        SET last_auth = CURRENT_TIMESTAMP
        WHERE users.users.username = un;
        
        RETURN ROW(
            'doadmin',
            EXTRACT(EPOCH FROM NOW() + INTERVAL '7 days'),
            authenticatee.id
        )::users.JWT;
    ELSE
        RETURN NULL;
    END IF;
END;
$$;


