--
-- Name: delete_entire_elevation(integer); Type: FUNCTION; Schema: public; Owner: doadmin
--

CREATE FUNCTION public.delete_entire_elevation(elevation_id integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    pid INTEGER;
    eid ALIAS FOR elevation_id;
BEGIN

    -- CHECK CURRENT USER

    SELECT project_id FROM elevations INTO pid
    WHERE id = eid;

    IF pid NOT IN (
        SELECT id FROM projects
        WHERE owner_id = get_current_user_id()
    ) THEN

        RAISE EXCEPTION 'Elevation not owned by user %', get_current_user_id();
        
    ELSE

        -- IF AUTHORIZED

        DELETE FROM container_details
            WHERE container_details.elevation_id = eid;

        DELETE FROM elevation_containers
            WHERE elevation_containers.elevation_id = eid;

        DELETE FROM elevations
            WHERE elevations.id = eid;
        
        RETURN eid;

    END IF;
END;
$$;


ALTER FUNCTION public.delete_entire_elevation(elevation_id integer) OWNER TO doadmin;

--
-- Name: delete_entire_project(integer); Type: FUNCTION; Schema: public; Owner: doadmin
--

CREATE FUNCTION public.delete_entire_project(project_id integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    cuid INTEGER;
    pid ALIAS FOR project_id;
    e elevations%ROWTYPE;
    ___ INTEGER;
BEGIN
    cuid := get_current_user_id();
    IF pid NOT IN (
        SELECT id FROM projects
        WHERE owner_id = cuid
    )
    THEN RAISE EXCEPTION 'Project does not belong to user: %', cuid;
    ELSE
        FOR e IN (
            SELECT * FROM elevations
            WHERE elevations.project_id = pid
        ) LOOP
            ___ := delete_entire_elevation(e.id);
        END LOOP;
        DELETE FROM projects
        WHERE projects.id = pid;
    END IF;
    RETURN project_id;
END;
$$;


ALTER FUNCTION public.delete_entire_project(project_id integer) OWNER TO doadmin;

