--

CREATE FUNCTION public.get_bug_reports() RETURNS public.entire_bug_report[]
    LANGUAGE plpgsql STABLE
    AS $$
DECLARE
    brs entire_bug_report[];
    br bug_reports%ROWTYPE;
BEGIN
    EXECUTE users.admin_only();

    FOR br IN (
        SELECT * FROM bug_reports
        ORDER BY timestamp ASC
    ) LOOP
        brs := brs || ROW(
            br.id,
            (SELECT username FROM users.users WHERE id = br.user_id),
            br.location,
            br.report,
            br.state,
            br.timestamp
        )::entire_bug_report;
    END LOOP;

    RETURN brs;

END;
$$;


