CREATE FUNCTION public.get_current_user() RETURNS users."current_user"
    LANGUAGE plpgsql STABLE SECURITY DEFINER
    AS $$
DECLARE
    uid INTEGER;
    un TEXT;
    r users.ROLE;
    pid INTEGER;
BEGIN
    SELECT id, username, role
    INTO uid, un, r
    FROM users.users
    WHERE id = get_current_user_id();

    SELECT id
    INTO pid
    FROM projects
    WHERE owner_id = uid;

    RETURN ROW(
        uid,
        un,
        r,
        pid
    )::users.CURRENT_USER;
END;
$$;


