--
-- Name: read_entire_class(integer); Type: FUNCTION; Schema: public; Owner: doadmin
--

CREATE FUNCTION public.read_entire_class(cid integer) RETURNS public.class
    LANGUAGE plpgsql
    AS $$
DECLARE
    subject TEXT;
    teacher PERSON;
    students PERSON[];
BEGIN

    SELECT c.subject FROM classes c
    INTO subject
    WHERE c.id = cid;

    SELECT t.id, t.first_name, t.last_name FROM people t
    INTO teacher
    WHERE t.id IN (
        SELECT c.teacher_id FROM classes c
        WHERE c.id = cid
    );

    SELECT ARRAY_AGG(ROW(s.id, s.first_name, s.last_name)::person) FROM people s
    INTO students
    WHERE s.id IN (
        SELECT e.student_id FROM student_class_enrollments e
        WHERE e.class_id = cid
    );

    RETURN ROW(
        cid,
        subject,
